  <Document>
    <name>balloonVisibility Example</name>
    <open>1</open>
    <gx:Tour>
      <name>Play me</name>
      <gx:Playlist>
        <gx:FlyTo>
          <gx:duration>5.0</gx:duration>
          <LookAt>
            <longitude>-119.748584</longitude>
            <latitude>33.736266</latitude>
            <altitude>0</altitude>
            <heading>-9.295926</heading>
